import React from "react";
import Header from "../header2/Header";

const WhatWeDo = () => {
  return (
    <>
      <section className="section-top">
        <Header />
        <img
          className="img-fluid w-100 "
          src="assest/photos/what-we-do/what-we-do-banner.png"
          alt="G-Rank"
        />
        <h1>WhatWeDo</h1>
      </section>
    </>
  );
};

export default WhatWeDo;
